import React from 'react'
import BlockInfo from '../../BlockInfo/BlockInfo'

function EditThemeListTeacherForm() {
  return (
    <>
    <BlockInfo>
    Вы можете редактировать уже созданные темы ВКР и добавлять новые. С помощью фильтрации можете выбрать нужные темы:
    по названию, наличию организации, а также свободные и занятые темы.
    </BlockInfo>
    </>
  )
}

export default EditThemeListTeacherForm
